import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      friends: [
        {
          name: "Elvira",
        },
        {
          name: "Lenara",
        },
        {
          name: "Vika",
        },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        <h1>{this.state.friend1.name}</h1>
        <h1>{this.state.friend2.name}</h1>
      </div>
    );
  }
}

export default App;
